import React from "react";

class PagesForm extends React.Component {

    render() {
        return(
            <div>
                <h2>Manage Pages</h2>
                <div className="card">
                <div className="card-header">
                    Form Fields
                </div>
                <div className="card-body">
                    <div className="row">
                        <div className="col-md-6">
                            <label>Select Pages</label>
                        </div>

                        <div className="col-md-6">

                        </div>
                    </div>
                </div>
                </div>

            </div>
        )
    }
}


export default PagesForm;
